const proffessions = ['Продавец', 'Укладчик день', 'Укладчик ночь'];

const getRandomInt = (min: number, max: number) =>
    Math.floor(Math.random() * (max - min + 1) + min);

const getRandomElement = (array: any[]) =>
    array[Math.floor(Math.random() * array.length)];

export default shops.map(s => {
    (s as any).Vacancies = [];
    (s as any).Kind = 'IShopVacancy';
    if (parseInt(s.Id) % 2 == 0) return s;
    (s as any).Vacancies = Array.from(Array(getRandomInt(0, 3))).map(x => ({
        Priority: getRandomInt(0, 5),
        Profession: getRandomElement(proffessions)
    }));
    return s;
})